// Ab.js
import React from "react";
import { MenuList } from "../helpers/articlelist";
import Log from "../assets/image9.jpg";
import MenuItem from "../components/MenuItem";
import "../styles/book.css";

function Ab() {
  return (
    <div className="about" style={{ backgroundImage: `url(${Log})` }}>
      <div className="aboutBottom">
        <h1>ARTICLES</h1>
        <div className="menu">
          <div className="menuList">
            {MenuList.map((menuItem, key) => {
              return (
                <MenuItem
                  key={key}
                  image={require(`../assets/${menuItem.image}`).default}
                  name={menuItem.name}
                  author={menuItem.author}
                  linkTo={menuItem.link}
                />
              );
            })}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Ab;
